import React from 'react';
import CBTExercise from './components/CBTExercise';

// Test component to verify CBT functionality
const TestCBT = () => {
  const testMood = {
    id: 'anxious',
    label: 'Anxious',
    emoji: 'ðŸ˜°',
    description: 'Feeling worried or nervous',
    color: 'anxious'
  };

  const handleComplete = () => {
    console.log('CBT Exercise completed successfully!');
  };

  const handleBack = () => {
    console.log('Back button clicked');
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-calm-50 to-primary-50 p-8">
      <h1 className="text-2xl font-bold mb-4">CBT Exercise Test</h1>
      <CBTExercise 
        mood={testMood}
        onComplete={handleComplete}
        onBack={handleBack}
      />
    </div>
  );
};

export default TestCBT;
